import React from "react";

import "./styles/global.css";
import "./styles/pages/landing-page.css";

function App() {
  return (
    <div className="App">
      <div id="landing-page">
        <div className="content-wrapper">
          <main>
            <h1>Igreja Presbiteriana do Recreio</h1>
            <p>Agende sua visita</p>
          </main>
          <footer>
            <button>Culto</button>
            <button>Jovens</button>
          </footer>
        </div>
      </div>
    </div>
  );
}

export default App;
